function getAudioParagraph(speakInfo) {
  let spliceAudioStartEndTimes = [];
  let startTime = speakInfo[0].start_time;
  let endTime = 0;
  const maxDuration = 60.0;

  speakInfo.forEach(timePeriod => {
      if (timePeriod.end_time - startTime > maxDuration) {
          spliceAudioStartEndTimes.push({ startTime: startTime, endTime: endTime });
          startTime = timePeriod.start_time;
      }
      
      endTime = timePeriod.end_time;
  });

  // 
  spliceAudioStartEndTimes.push({ startTime: startTime, endTime: endTime });

  console.log("Get audio paragraph response:", spliceAudioStartEndTimes);
  
  return spliceAudioStartEndTimes;
}


